import React from 'react';
import CustomButton from '../Components/Button.jsx';
import CopyrightText from '../Components/CopyrightText';
import { useHistory } from 'react-router-dom';

function Login() {
  const history = useHistory();

  const handleLogin = () => {
    // Logique de connexion
    // Une fois la connexion réussie, naviguer vers la page d'accueil
    history.push('/accueil');
  };

  return (
    <div>
      <img src="/logo.png" alt="Logo de l'application" />
      <form>
        <div>
          <label htmlFor="username">Nom d'utilisateur :</label>
          <input type="text" id="username" name="username" />
        </div>
        <div>
          <label htmlFor="password">Mot de passe :</label>
          <input type="password" id="password" name="password" />
        </div>
        {/* Appel de la fonction handleLogin lors du clic sur le bouton */}
        <CustomButton variant="login" onClick={handleLogin} />
      </form>
      <CopyrightText />
    </div>
  );
}

export default Login;
